<script type=""text/javascript"">
    var $ = window.jQuery;
    var app = new Vue({
        el: '#app',
        data: {
            rows: [],
            pi: 0,
            pages: [],

        },
        mounted() {
            this.loadData();
        },
        methods: {
            GetHref(href) {
                return ""Patient/"" + href;
            },
            edit(item) {
                window.location = 'Patient/' + item.claimnumber;
            },
            loadData(pageIndex = 1) {
                let that = this;
                var ps = $(""#pageSize"").val();
                var search = $(""#search_criteria"").val();
                var vic = 0;
                this.pi = pageIndex;
                that.rows = new Array();
                $.ajax({
                    type: ""POST"",
                    url: ""Dashboard"",
                    dataType: ""json"",
                    contentType: ""application/json; charset=utf-8"",
                    data: JSON.stringi");
            WriteLiteral(@"fy({ ""SearchCriteria"": search, ""PageIndex"": pageIndex - 1, ""PageSize"": ps }),
                    success: function (data) {
                        $(data).each(function (index, d) {
                            if (index == 0) {
                                vic = d.virtualItemCount;
                            }
                            if (d) {
                                that.rows.push(d);
                            }
                        });
                        that.pages = new Array();
                        for (var i = 0; i <= vic / ps; i++) {
                            that.pages.push(i + 1);
                        }
                    },
                    failure: function (errMsg) {
                        alert(errMsg);
                    }
                });
            }
        }
    })
</script>
<style>
    body {
        font-size: 8pt;
    }

    .ctd {
        text-align: right !important;
    }
